Announcing the Virtual Event of the Year! 🇮🇱

In order to unite the Jewish People together, I am excited to launch a revolutionary, first-of-its kind, “All-Star Jewish Summit!”

And, in preparation for this year’s JBiz event, we’re offering this virtual event FREE OF CHARGE!

Join us next Thursday for a virtual fireside chat, showcasing how “Torah, Business, and Unity” are the essence of the Jewish People!

We’ve built a team of the greatest Jewish thought-leaders, world-renowned speakers, and “success stories,” for a never-before-seen event that will inspire anyone and everyone!

Each of these speakers on their own would be enough to draw the entire Jewish world together; but we’re bringing them all into one place, at one time, for a virtual event that will not only help solidify the unity of the Jewish People, but help take our individual and collective vision of growth to the next level!

And we’ve scheduled it for 12pm EST, so that everyone can join us, especially those of us living in Israel! 🇮🇱

*

Bringing it all back home:

The past seven weeks have proven to the world, and to ourselves, that we are one people; one nation; one family!

So for all my Jewish friends and family around the world, this is going to be the virtual event of the year; the event that takes our collective unity and vision to the next level!

Reserve your spot today before they run out, and please spread the word.

Can’t wait to see you there! 🇮🇱

